export function GameStart(func) {
    var preCardsArr = [];

    for (let i = 0; i < level*3; i++) {
        preCardsArr.push(GuessCard(i, func))
    }

    return (
        <>
            <h3>Choose the right card to move onto the next level!</h3>
            <table className="cards">
                <tr>
                    {preCardsArr}
                </tr>
            </table>
        </>
    )
}
